import React from 'react';
import { Link } from 'react-router-dom';
import '../Home.css'
const Home = () => (
    <div>
        <h1>Welcome to Job Portal</h1>
        <Link to="/login">Login</Link>
        <Link to="/register">Register</Link>
    </div>
);

export default Home;
